/* eslint-disable */
import { PrismaClient } from '@prisma/client';
import { faker } from '@faker-js/faker';
import * as bcryptjs from 'bcryptjs';
import { max } from 'class-validator';
const prisma = new PrismaClient();

async function main() {

  const hash = bcryptjs.hashSync('123456', 10);

  await prisma.adminUser.deleteMany({ where: {} });
  await prisma.adminUser.createMany({
    data: [
      { first_name: 'Admin', last_name: 'user', email: 'admin@email.com', password: hash },
    ],
    skipDuplicates: true,
  });

  await prisma.subject.deleteMany({ where: {} });
  await prisma.subject.createMany({
    data: [
      { name: 'Chemistry', is_popular: true },
      { name: 'Physics', is_popular: true },
      { name: 'Biology', is_popular: false },
      { name: 'Mathematics', is_popular: false },
      { name: 'History', is_popular: false },
      { name: 'English Literature', is_popular: false },
      { name: 'Computer Science', is_popular: true },
      { name: 'Art History', is_popular: true },
      { name: 'Psychology', is_popular: true },
      { name: 'Sociology', is_popular: true },
    ],
    skipDuplicates: true,
  });

  //exam boards
  await prisma.examBoard.deleteMany({ where: {} });
  await prisma.examBoard.createMany({
    data: [
      {
        name: 'WJEC',
        logo: 'data:image/png;base64,'
      },

      {
        name: 'OCR',
        logo: 'data:image/png;base64,'
      },

      {
        name: 'Edexcel',
        logo: 'data:image/png;base64,'
      },
      {
        name: 'AQA',
        logo: 'data:image/png;base64,'
      },
    ],
    skipDuplicates: true,
  });

  await prisma.level.deleteMany({ where: {} });
  await prisma.level.createMany({
    data: [{ name: 'GCSE' }, { name: 'A-Level' }, { name: 'AS-Level' }],
    skipDuplicates: true,
  });

  await prisma.testimonial.deleteMany({ where: {} });
  await prisma.testimonial.createMany({
    data: [
      {
        desc: 'From covering new content to prepping for exams, my teacher was great at providing a variety of resources to fill the gaps in our knowledge. Above all, he is a committed teacher who strives to instil his students with enthusiasm and ambition, qualities which remain important beyond your time in education.',
        student_name: 'Suraiya',
        subject: 'Geography',
        school: 'University College London',
        image: '',
        is_student: true,
        sort_order: 1,
      },
      {
        desc: 'As a student passionate about literature, my teacher not only helped me understand complex literary concepts but also inspired me to explore the world of books further. Their dedication to teaching is truly commendable.',
        student_name: 'Liam',
        subject: 'Literature',
        school: 'Oxford University',
        image: 'liam.jpg',
        is_student: true,
        sort_order: 2,
      },
    ],
  });

  await prisma.faq.deleteMany({ where: {} });
  await prisma.faq.createMany({
    data: [
      {
        question: 'What is exam success and how does ESPD promote it?',
        answer:
          'We guarantee exam success through guaranteeing students access to quality first tutors who are fully qualified teachers from universities and teaching practices in the UK and have at least three years experience teaching and raising achievement in their subject(s) as well as current and clear DBS checks. We ensure that every tutorial involves our tutors understanding exactly what students require support with, sensitively and effectively closing the gap in curriculum knowledge and exam skill and then ensuring that the student is empowered to answer an exam question by the end of each tutorial.',
        sort_order: 1,
      },
      {
        question: 'How does ESPD select its tutors?',
        answer:
          "ESPD selects tutors who are fully qualified teachers from universities and teaching practices in the UK. Our tutors have at least three years' experience teaching and improving student achievement in their subject areas. Additionally, they undergo current and clear DBS checks to ensure the safety and security of our students.",
        sort_order: 2,
      },
    ],
    skipDuplicates: true,
  });

  //faker ref: https://fakerjs.dev/api/
  //student
  await prisma.student.deleteMany({ where: {} });
  const student = (): any => ({
    first_name: faker.person.firstName(),
    last_name: faker.person.lastName(),
    email: faker.internet.email(),
    phone: faker.phone.number(),
    password: hash,
    is_verified: true,
    profile_photo: faker.image.avatar(),
  });
  for (let i = 0; i < 15; i++) {
    await prisma.student.create({ data: student() });
  }

  await prisma.teacher.deleteMany({ where: {} });
  const teacher = (): any => ({
    first_name: faker.person.firstName(),
    last_name: faker.person.lastName(),
    email: faker.internet.email(),
    phone: faker.phone.number(),
    password: hash,
    profile_photo: faker.image.avatar(),
    experience: faker.number.int(50),
    is_dbs_checked: faker.datatype.boolean(),
    is_super_tutor: faker.datatype.boolean(),
    bio: faker.lorem.words(3),
    price_group: 30,
    price_one_to_one: 40,
  });

  for (let i = 0; i < 20; i++) {
    await prisma.teacher.create({ data: teacher() });
  }

  //feature
  await prisma.feature.deleteMany({ where: {} });
  await prisma.feature.createMany({
    data: [
      {
        title: 'Qualified Teachers',
        description: 'At ESPD, we take pride in providing the highest standard of education, and it all starts with our exceptional team of qualified teachers. Each of our teachers holds official accreditation from renowned universities and teaching practice centers within the UK.',
        image: 'data:image/png;base64,'
      },
      {
        title: 'Experienced Teachers',
        description: 'Experience matters, and at ESPD, we understand the significance of having seasoned educators. That\'s why we handpick teachers who have a minimum of three years of teaching experience.',
        image: 'data:image/png;base64,'
      },
      {
        title: 'Background Checked',
        description: 'The safety and well-being of our students are paramount. To ensure that our learning environment remains secure, all our teachers undergo rigorous DBS (Disclosure and Barring Service) criminal record checks.',
        image: 'data:image/png;base64,'
      },
    ],
    skipDuplicates: true,
  });

  //settings
  await prisma.setting.deleteMany({ where: {} });
  await prisma.setting.createMany({
    data: [
      {
        key: 'email',
        value: 'tuition@provider.com',

      },
      {
        key: 'phone',
        value: '34523523',
      },
      {
        key: 'desc',
        value: 'We are an online tuition service that empowers GCSE and A Level students to achieve grades 6-9 at GCSE and B-A* grades at A Level so that they can progress to the colleges, universities, apprenticeships and careers of their dreams.',
      },
      {
        key: 'instagram',
        value: 'https://instagram.com',
      },
      {
        key: 'facebook',
        value: 'https://facebook.com',
      },
      {
        key: 'youtube',
        value: 'https://youtube.com',
      },
      {
        key: 'tiktok',
        value: 'https://tiktok.com',
      },
    ],
    skipDuplicates: true,
  });
}
main()
  .then(async () => {
    await prisma.$disconnect();
  })
  .catch(async (e) => {
    console.error(e);
    await prisma.$disconnect();
    process.exit(1);
  });
